import React, { Component } from "react";
// import ContactsArray from "./../contacts.json";
import FilterNav from "./FilterNav.js";

import "./ArticlesTable.css";

class ArticlesTable extends Component {
  constructor(props) {
    super(props);
    this.state = { contacts: ContactsArray.splice(0, 9) };
  }

  sortName() {
    const startState = this.state.contacts;

    startState.sort((a, b) => a.name.localeCompare(b.name));

    this.setState({ contacts: startState });
  }

  render() {
    const { contacts } = this.state;
    return (
      <section className="articles-table-page">
        <div className="page-title-and-filters">
          <h3 className="page-title">Page Title</h3>

          {/* <FilterNav /> */}
        </div>
      </section>
    );
  }
}

export default ArticlesTable;
